紫外線や雨、雪、ホコリ等による劣化からタイヤを守ります。<br><br>冬の時期の夏タイヤ保管用や、夏のスタッドレスタイヤ保管用に最適です。<br>タイヤ4本を積み重ね、上からタイヤカバーをかぶせるだけなので簡単に使用可能です。<br><br><br>●使用時サイズ<br><br>直径：580mm<br>高さ：760mm<br><br>●参考タイヤサイズ<br><br>165/50R15<br>155/65R14<br>165/55R14<br>155/65R13<br><br>●収納可能サイズ（1本あたり）<br><br>タイヤ幅：165mm以下<br>外径：570mm以下<br><br>●参考適合車種：ワゴンR、ムーブ、ライフ、ekワゴンなどの軽自動車<br><br><br>●メーカー品番：TC-01<br>●メーカー：大自工業/メルテック<style type="text/css">
